import React, { useEffect } from "react";
const Users=()=>{
    let [content,setContent]=useState([])
    useEffect(()=>{
        axios.get("http://localhost:3000/users")
        .then((response)=>{
            console.log("Got The Data");
            setContent(response.data)
        }).catch(()=>{
            console.log("Something went Wrong");
        })
    },[])
